import React from 'react';
import styles from './ContactUs.module.css';

function ContactUs() {
  return (
    <div className={styles.container}>
      <div className={styles.card}>

      
      <h1>Contact Us</h1>
      <p className={styles.paragraph}>
If you have any questions about this policy or your privacy while using Trackpeek, feel free to reach out:</p>
<p className={styles.paragraph}>Email: support@trackpeek.com</p>
    </div>
    </div>
  );
}

export default ContactUs;
